Clicktrans is a marketplace for transport services. Here you will find partial and full truck loads.

The mobile application is available for transport providers verified by Clicktrans. Thanks to the application you will always have new listings at hand!

Already have an account at Clicktrans? Download the application "Clicktrans - for Couriers" and get instant benefits: 
- access to thousands of delivery jobs - whenever you want, wherever you are;
- your quotes are always at hand;
- you will respond faster to messages from customers;
- you will always be up to date thanks to the notifications;
- accept Quick Deals with one click;
- access your accepted quotes, even when you're offline;
- receive information about jobs for the route that suits you, according to your needs.

Don't have an account at Clicktrans yet? Register now for free!
